import React from "react";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import Slider from "react-slick";
import "./imageSlider.css";
// import $ from "jquery";

const ImageSlider = () => {
  let settings = {
    dots: false,
    infinite: true,
    speed: 1000,
    slideToShow: 1,
    slideToScroll: 1,
    autoplay: true,
    arrows: false,
  };
  return (
    <div className="">
      <Slider {...settings} className="slider">
        <div className="p">
          <div class=" relative h-72 w-full sm:h-36 md:h-48 lg:h-64">
            <img
              src="/assets/images/bleach_bg.jpg"
              alt=""
              className="object-cover absolute top-0 left-0 w-full h-full"
            />
          </div>
        </div>
        <div class="">
          <div class=" relative h-72 w-full sm:h-36 md:h-48 lg:h-64">
            <img
              src="/assets/images/bleach_bg.jpg"
              alt=""
              className="object-cover absolute top-0 left-0 w-full h-full"
            />
          </div>
        </div>
        <div class="">
          <div class=" relative h-72 w-full sm:h-36 md:h-48 lg:h-64">
            <img
              src="/assets/images/bleach_bg.jpg"
              alt=""
              className="object-cover absolute top-0 left-0 w-full h-full"
            />
          </div>
        </div>
      </Slider>
    </div>
  );
};

export default ImageSlider;
